CREATE DEFINER=`root`@`localhost` PROCEDURE `filter_res`(
	in time_of_day int,reserve_day date, start_txt varchar(40), end_txt varchar(40)
)
BEGIN
-- Created by Kristan Singh

declare time_start time;
declare time_end time;
declare start_loc int;
declare end_loc int;
declare dir int;

if time_of_day = 0 then
begin
	set time_start = "06:00:00";
    set time_end = "12:00:00";
end;
elseif time_of_day = 1 then
begin
	set time_start = "12:00:00";
    set time_end = "18:00:00";
end;
elseif time_of_day = 2 then
begin
	set time_start = "18:00:00";
    set time_end = "00:00:00";
end;
else 
begin
	set time_start = "00:00:00";
    set time_end = "06:00:00";
end;
end if;


set start_loc = (select station_id from stations where station_name = start_txt);
set end_loc = (select station_id from stations where station_name = end_txt);

-- Need to reverse if to get the correct values...
if start_loc > end_loc then 
begin
	set dir = 1; 
    set start_loc = (select station_id from stations where station_name = end_txt);
set end_loc = (select station_id from stations where station_name = start_txt);
end;
	else
begin
    set dir = 0;
end;
end if;


select 
s1.train_id, 
s1.time_in as 'departure',
s1.station_id as 'start',
s2.time_in as 'arrival',
s2.station_id as 'end',
free.seat_free_date as 'date',
(select min(freeseat) from seats_free where seats_free.segment_id between start_loc and end_loc-1 and seat_free_date = reserve_day) as 'free_seats',
(select sum(seg_fare) from segments where seg_n_end between start_loc and end_loc-1) as 'price'

from stops_at as s1
left join 
		(
			select f1.train_id, f1.seat_free_date
			from seats_free f1
			left join seats_free as f2 on f1.train_id = f2.train_id
			where f1.seat_free_date = reserve_day and f2.seat_free_date = reserve_day and f1.segment_id = start_loc and f2.segment_id = end_loc-1
        ) as free on free.train_id = s1.train_id
left join stops_at as s2 on s2.train_id = s1.train_id
left join trains on s1.train_id = trains.train_id
where s1.time_in between time_start and time_end and s1.station_id = start_loc and s2.station_id = end_loc and free.seat_free_date is not null and trains.train_direction = dir;
END ;;
